"Waypoint" is a property defined by 3 simple properties: latitude (double), longitude (double) and altitude (double). Waypoint is represented as a owl Class, subclass of Component and as domain of the 3 simple properties.

:Component_Waypoint rdf:type owl:Class ;
   rdfs:subClassOf :Component .

:latitude rdfs:Domain :Component_Waypoint ;
  rdfs:range xsd:double .

:longitude rdfs:Domain :Component_Waypoint ;
  rdfs:range xsd:double .

:altitude rdfs:Domain :Component_Waypoint ;
  rdfs:range xsd:double .

The category is linked to the component with a owl:Object property:

?category :hasWaypoint :Component_Waypoint .

:hasWaypoint rdf:type owl:ObjectProperty ;
   rdfs:domain ?category ;
   rdfs:range :Component_Waypoint .

* Warning: Do not use the IRI to extract the name. Use rdfs:label or :name instead.
